import React from "react";
import { Route, Routes } from "react-router-dom";
import ComplaintsUser from "./pages/Signedin/ComplaintsUser";
export default function Complaints() {
  return;
  <>
    <Routes>
      <Route path="/user" element={<ComplaintsUser />} />
    </Routes>
    ;
  </>;
}
